import React from "react";
// Importing Link from react-router-dom to
// navigate to different end points.
import { Link } from "react-router-dom";

const Home = () => {
    return (
        <div>
            <header className={"Header"}>
                <div className={"wrap"}>
                    <title className={"block"}>
                        <image className={"img"} >  <Link to="/contactus"  >Меню</Link> </image>
                        <label className={"labels"}> Кто мы есть</label>
                        <p className={"p"}> Мы- местный семейный ресторан с полным сектором услуг, где подают пиццу в неополитанском стиле.</p>
                    </title>
                </div>
            </header>
            <footer>
                <div className={"wrapper"}>
                    <label className={"label"}> Контакты:</label>
                    <label className={"labelContact"}> Телефон: 8-999-345-21-45</label>
                    <label className={"labelMail"}> Почта: pxutornayaaa@gmail.ru</label>
                    <a href={' https://nicepage.com/ru/k/ресторан-shablony-veb-saytov'} className={"labelHref"}> Связаться со мной</a>
                </div>
            </footer>

        </div>
    );
};

export default Home;
